import React from 'react';

function SearchOptions({ query, setQuery }) {
    const updateQuery = (e) => {
        const {name, checked} = e.target;

        setQuery({...query, [name]: checked})
    };

    return (
        <div>
            <label>
                <input type="checkbox" name="courseCode" onChange={ updateQuery }/>
                Course Code
            </label>
        </div>
    );
}

export default SearchOptions;
